import React from "react";
import logo from "./logo.svg";
import "./App.css";
import Card from "./component/Card";

class App extends React.Component {
  constructor() {
    super();
    this.state = {
      item: {}
    };
  }

  componentDidMount() {
    this.setState({ loading: true });
    fetch(
      "https://v2-api.sheety.co/69072a59b5982e9dd27aaa5bf290e8c6/colorsnt/data/3"
    )
      .then(response => response.json())
      .then(data => {
        console.log(data.datum);
        this.setState({
          item: data.datum
        });
      });
  }

  render() {
    return (
      <div>
        <h1>test</h1>
      </div>
    );
  }
}

export default App;
